import React, { useState } from "react";
import Button from '@material-ui/core/Button';
import AddCircleOutlineIcon from '@material-ui/icons/AddCircleOutline';


function Createnote() {
    const [state, setstate] = useState("");
    const [newstate, newsetstate] = useState("");


    const getInput = (e) => {
        setstate(e.target.value)

    }
    const getInputText = (e) => {
        newsetstate(e.target.value)
    }

    return (
        <>
            <div className="notes">
                <form>
                    <input type="text" placeholder="Title" onChange={getInput} value={state} />
                    <textarea rows="5" cols="50" placeholder="write a note..." autoComplete="off" onChange={getInputText} value={newstate}></textarea>
                    <Button className="bttn"><AddCircleOutlineIcon className="btn-sign" /></Button>

                </form>

            </div>

        </>
    )
}

export default Createnote;
